pragma solidity 0.7.6;

import '../interfaces/IERC20.sol';
import '@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router01.sol';

library UniswapV2 {
    function Price(address provider, address tIn,address tOut) external view returns (uint256){
        address[] memory path = new address[](2);
        path[0] = tIn;
        path[1] = tOut;
        uint[] memory amounts = IUniswapV2Router01(provider).getAmountsOut(10**IERC20(tIn).decimals(),path);
       return amounts[1];
    }

}

